import React from 'react';
import CardBody from './card-body';
import CardHead from './card-head';

function Archive(props: any) {
  return (
    <>
      <div className="bg-grey-3 card-body flex-center flex-column">
        <div className="column">
          <div className="card-box">
            {/* <CardHead column={props.archive} /> */}
            <div
              className={`display-flex archive h-top bg-grey-2 cursor-pointer`}
            >
              <div className="icon-box">
                <i className="fas fa-archive"></i>
              </div>
              <div>Archive</div>
            </div>
            <CardBody column={props.archive} convertDate={props.convertDate} />
          </div>
        </div>
      </div>
    </>
  );
}
export default Archive;
